      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT col0 * + ( + + col1 ) BETWEEN NULL AND ( + - ( col0 ) * col1 );
  - name: tab1

outputs:
  - name: q10868.out
    data: |
      51	14	96
      85	5	59
      91	47	68
